var tipuesearch = {"pages": [{'title': 'About', 'text': '本學期的電腦輔助設計實習, 要求每一位學員根據本 HW template 的格式建立個人的作業倉儲與網頁. \n \n 40923106 \n 我的倉儲網址: https://github.com/40923106/cad2021_hw \n 我的網站網址: https://40923106.github.io/cad2021_hw/content/index.html \n 2021/9/27 遠距線上課程 創建個人倉儲及網站 \n 2021/10/4 實體上課\xa0 \n 2021/10/18 wink \n 2021/10/25 因電腦教室要更換電腦所以這周線上上課 \n 2021/11/1 分組 \n 2021/11/8 老師電腦出問題 \n', 'tags': '', 'url': 'About.html'}, {'title': 'W11', 'text': '根據\xa0 https://mde.tw/cad2021_hw/content/W11%20%E6%9F%A5%E9%A9%97.html \xa0的內容繪製出四連桿(尺寸自己訂) \n 零件檔案\xa0 https://drive.google.com/drive/u/1/folders/1JxHmQjZgetcmZC18Qx3BH0GPsf3rlVUG \n sw onshape 繪製過程(wink) \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W11.html'}, {'title': 'HW1', 'text': '透過老師亂數分配，我所被分配到要使用的軟體是Solidworks跟Onshapes \n \n \n HW1 具體項目成果回報區 \n 作業一: meArm Robot 零件繪圖與機電運動模擬場景製作 \n 1. 下載  meARM.7z \xa0及\xa0 meArm_75-0040_v1.pdf \xa0. \n 2. : 從課程網頁中的  Compile CoppeliaSim 頁面 , 下載  coppeliaSim 4.1.0 官方版與 MSYS2 編譯版.7z \xa0可攜套件. \n 3. : 透過老師分配的亂數分配 套件結果:\xa0 https://mde.tw/cad2021/downloads/online/2a_hw1_cad.txt \xa0我所被分配到的兩套軟體分別為solidworks跟onshape，並下載上述兩項軟體安裝以及使用. \n 根據 1. 中的零件尺寸, 畫meArm Robot 各零件並組立. 再將零件 匯入  CoppeliaSim 進行組裝配置後, 以  UI 介面 中的 slider 控制 meArm Robot 各軸的旋轉作動\\ \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'SolideWorks繪圖', 'text': '\n', 'tags': '', 'url': 'SolideWorks繪圖.html'}, {'title': 'SolidWorks安裝配置', 'text': '本身電腦就有安裝sw2018 \n', 'tags': '', 'url': 'SolidWorks安裝配置.html'}, {'title': 'SolidWorks操作流程', 'text': '\xa0零組件繪圖操作流程影片 https://youtu.be/ytkgyayNv14 \n \n \xa0零組件繪圖教學影片(wink) \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'SolidWorks操作流程.html'}, {'title': 'Onshape繪圖', 'text': '\n', 'tags': '', 'url': 'Onshape繪圖.html'}, {'title': 'Onshape配置', 'text': '\n \n', 'tags': '', 'url': 'Onshape配置.html'}, {'title': 'Onshape操作流程', 'text': '\xa0零組件繪圖操作流程影片\xa0 https://youtu.be/BxnUYnm5OAA \n \n 零組件繪圖教學影片(wink) \n \xa0 \n \n \n \n \n   \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'Onshape操作流程.html'}, {'title': '運動場景', 'text': 'solideworks零件轉出後轉入 CoppeliaSim 操作影片 (Youtube)\xa0 https://youtu.be/GXaXOW88TK4 \n \n solideworks零件轉入 CoppeliaSim 教學影片 (Wink)\xa0 \n \n \n Onshape零件轉出後轉入 CoppeliaSim 操作影片 (Youtube)\xa0 https://youtu.be/TMdb2HZewwo \n \n Onshape零件轉入 CoppeliaSim 教學影片 (Wink)\xa0 \n', 'tags': '', 'url': '運動場景.html'}, {'title': 'W13', 'text': '兩套 CAD 零組件繪圖進度\xa0 \n \n \n \n \n \n   \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W13.html'}, {'title': 'HW1-1', 'text': 'HW1-1 佔學期成績 15% \n HW1-1 必須在 2021.12.01 22:00 之前完成. \n HW1-1 具體項目成果回報區 將於 2021.11.18 開啟, 於  2021.12.01 22:00 關閉. \n 作業 1-1: Mirobot 機械手臂場景組合 \n 說明: meArm Robot 有四個自由度, 請根據 HW1 的零組件繪製組立與 CoppeliaSim 運動場景模擬, 延伸至  Task1-1  中六個自由度的 Mirobot 機械手臂. \n mirobot_part1_to_part5.7z  為取自 \xa0 https://github.com/wlkata/Mirobot-STL  的參考零件. 請利用場景中 Mirobot STL 零件, 組合為可以透過  UI 介面 中的 slider 控制各軸作動旋轉的運動模型. \n 請根據  Task1-1  中的說明, 完成各項指定任務. \n', 'tags': '', 'url': 'HW1-1.html'}, {'title': 'HW2', 'text': 'HW2 佔學期成績 20% \n HW2 必須在 2021.12.22 22:00 之前完成. \n HW2 具體項目成果回報區 將於 2021.12.09 開啟, 於  2021.12.22 22:00 關閉. \n meArm 逆向運動學與網際參數式 CAD API 結合應用. \n 將  https://github.com/mdecourse/meArm  中的 meArm Robot 逆向運動學程式, 改為 Lua 與 Python 程式, 使能套用至 HW1 所完成的 CoppeliaSim meArm 運動模擬場景. 並分別採 Lua, Legacy remote API 及 Bluezero remote API 逆向運動的方式進行控制. \n 利用  Task2  中的 Solidworks, Inventor 與 NX API 程式控制 meArm Robot 零組件尺寸, 說明並討論如何透過網際程式控制 meArm Robot 的零件尺寸, 結合上述逆向運動學程式庫, 使得自動化機電產品開發流程更容易滿足客製化需求. \n \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'HW3', 'text': 'HW3 為選項作業. \n HW3 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n https://mde.tw/cad2021/content/Task3.html \xa0 \n https://mde.tw/cad2021/content/Task4.html \n https://mde.tw/cad2021/content/Task5.html \n https://mde.tw/cad2021/content/Task6.html \n https://mde.tw/cad2021/content/Task7.html \n 從上列 Tasks 中自行選擇項目內容完成 HW3. \n \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'Final Project', 'text': 'Final Project 佔學期成績 40% \n 2a 與 2b 必須在 2022.01.06 上課之前完成 Final Project \n Final Project 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n 彈性製造系統場景設計與製作 \n 從\xa0 https://github.com/mdecourse/scenes  與  https://github.com/mdecourse/models  中選擇場景或模型, 配合  cad2021_textbook.pdf  (登入 @gm 帳號後下載) 教材中的內容, 自選製作與組立產品, 組合成一個 Flexible Manufacturing System 系統場景. \n \n', 'tags': '', 'url': 'Final Project.html'}, {'title': 'Wink下載', 'text': '\n \n \n \n \n   \n \n \n \n \n \n \n', 'tags': '', 'url': 'Wink下載.html'}]};